import React from "react";

function About() {
    return (
        <section className="card bio-card parallax" id="about">
            <div className="card-header glowBox page-header">
                About Me
            </div>
            <div className="card-body glowBox">
                <p>
                    I grew up in Maryland (Go Ravens!). I have always enjoyed computers, technology, and building new things. </p>
                <p>
                    I currently work as a cybersecurity analyst. I am striving to learn more development so that it will help me to advance my career. </p>
                <p>
                    My hobbies include long walks with my dog, going to the gym, painting, building Legos, reading comics, and gaming. </p>
                <p>
                    In Gloomhaven, I am a level 9 Inox Brute with 26 HP. My favorite abilities are Skewer and Juggernaut. </p>
            </div>
        </section>
    );
}

export default About;
